import { useState } from 'react';
import axios from 'axios';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

interface SunEvent {
  date: string;          
  sunrise: string;        
  sunset: string;
  golden_hour: string;
}


function App() {
  const [location, setLocation] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [data, setData] = useState<SunEvent[]>([]);

  const fetchData = async () => {
    console.log('Fetching data with:', { location, startDate, endDate });
    try {
      const response = await axios.get('http://localhost:3000/sunrise', {
        params: { location, date_start: startDate, date_end: endDate }
      });
      console.log('Data received from backend:', response);
      setData(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
      alert('Error fetching data');
    }
  };


  return (
    <div style={{ padding: '20px' }}>
      <h1>Sun Event Tracker</h1>

      <input
        placeholder="Location"
        value={location}
        onChange={e => setLocation(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <input
        type="date"
        value={startDate}
        onChange={e => setStartDate(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <input
        type="date"
        value={endDate}
        onChange={e => setEndDate(e.target.value)}
        style={{ marginRight: 10 }}
      />
      <button onClick={fetchData}>Get Data</button>

      {data.length > 0 && (
        <>
          <h2>Results</h2>
          <table border={1} cellPadding={5} cellSpacing={0}>
            <thead>
              <tr>
                <th>Sunrise</th>
                <th>Sunset</th>
                <th>Golden Hour Start</th>
              </tr>
            </thead>
            <tbody>
              {data.map(event => (
                <tr key={event.golden_hour}>
                  <td>{event.sunrise}</td>
                  <td>{event.sunset}</td>
                  <td>{event.golden_hour}</td>
                </tr>
              ))}
            </tbody>
          </table>


        </>
      )}
    </div>
  );
}

export default App;
